import { RestaurantCard } from "./RestaurantCard"

function RestaurantTable(props) {


    const { list } = props
   console.log(list); 
    return (
        <table border="1px">
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Rating</th>
                    <th>Type</th>
                    <th>Number of Votes</th>
                    <th>Price Starts From</th>
                </tr>
            </thead>
            <tbody>

                {list.map((item) => {
                    return (
                    <RestaurantCard 
                      key = {item.id}
                        name={item.name}
                        rating={item.rating}
                        type={item.type}
                        number_of_votes={item.number_of_votes}
                        price_starts_from = {item.price_starts_from}
                         />
                    )
                })}

            </tbody>
        </table>
    )
}

export default RestaurantTable
